#'
#'
#' @format A data frame with 6 rows and 3 variables:
#' \describe{
#'   \item{age_band}{Age Group, <1, 1-4, 5-9, 10-14, 15-19, 20+}
#'   \item{height_lo}{Minimum value for height in cm}
#'   \item{height_hi}{Maximum value for height in cm}
#' }
"height_in_cm"

#' Weight measurements
#'
#' A data frame defining reasonable weight ranges by age. Min and max
#' values are derived from NHANES 2015-2018 data and, therefore, assume population
#' distribution of weight values in the country of interest is similar
#' to that of the U.S. The 5th percentile was taken as the min and the 95th
#' percentile was taken as the max.
#'
#'
#' @format A data frame with 6 rows and 3 variables:
#' \describe{
#'   \item{age_band}{Age Group, <1, 1-4, 5-9, 10-14, 15-19, 20+}
#'   \item{height_lo}{Minimum value for weight in kg}
#'   \item{height_hi}{Maximum value for weight in kg}
#' }
"weight_in_kg"

#' ARV side effects
#'
#' This dataset is a list of regimens and their associated side effects, derived
#' from Chat GPT. Each row represents a side effect-regimen pair.
#'
#'
#' @format A data frame with 71 rows and 4 variables:
#' \describe{
#'   \item{side_effect}{Side effect}
#'   \item{regimen_abbv}{Abbreviation of the regimen}
#'   \item{regimen_desc}{Name of regimen}
#'   \item{side_effect_rarity}{Rarity of listed side effect for the regimen.
#'   "Rare" indicates rare side effect. NULL indicates common.}
#' }
"arv_side_effects"
